import React from 'react'

import Head from './Header'

import SubHeader from './SubHeader'

const HelloWorld = function () {
  return (
    <div>
        <div>HelloWorld</div>
        <Head/>
        <SubHeader/>
    </div>
    
  )
}

export default HelloWorld
